import { StyleSheet } from "react-native";

export const s = StyleSheet.create({
  app: {
    flex: 1,
    backgroundColor: "#F9F9F9",
  },
  header: {
    flex: 1,
    backgroundColor: "red",
  },
  body: {
    flex: 5,
    backgroundColor: "blue",
  },
  footer: {
    height: 70,
    backgroundColor: "green",
  },
});
